    void _assertDeterministic(const std::string &value) {
#ifdef WIN32
        auto id = GetCurrentThreadId();
        pthread_barrier_wait(&barrier);

        if (id == mainThreadId) {
            pthread_barrier_wait(&barrier);
            if (value != *currentDeterValue) {
                logger.raw(value);
                logger.raw(*currentDeterValue);

                assertThrow(false, "Not determinist");
                abort();
            } else {
                *haveCurrentDeterValue = false;
            }
        } else {
            *haveCurrentDeterValue = true;
            *currentDeterValue = value;
            pthread_barrier_wait(&barrier);
        }

        pthread_barrier_wait(&barrier);
#endif
    }

